import { StyleSheet } from 'react-native';
import styles from '../../screens/Home/styles';

const syles=StyleSheet.create({
    container:{
        position:'absolute',
        left:0,
        right:0,
        top:0,
        bottom:0,
        width:'100%',
        height:'100%',
        backgroundColor: 'black',
        opacity:'0.4'
    }
})
export default styles
